


// Contenido del popup para cada feature
function popupContentPuestos(feature, layer) {
    return (
        "<div id='Estilo1'><h3>Descripción</h3></div>" +
        "<hr class='hrx' style='color: #ef7d26;' align='left' noshade='noshade' size='1' width='100%' />" +
        "<div id='Estilo3a'>" +
        "<b> Nombre del Puesto o Comunidad: </b>" + feature.properties.NOMBRE + "<br>" +
        "<b> Tipo de Abastecimiento: </b>" + feature.properties.TIPO_ABAST + "<br>" +
        "<b> Descripcion del Abastecimiento: </b>" + feature.properties.ABASTECIMI + "<br>" +
        "<b> Número de familias: </b>" + feature.properties.NUM_FAMILI + "<br>" +
        "<b> Particular: </b>" + feature.properties.PARTICULAR + "<br>" +
        "<b> Prioridad: </b>" + feature.properties.PRIORIDAD + "<br>" +
        "</div>"
    )
};


function getColorPuestos(TIPO_ABAST) {
    switch (TIPO_ABAST) {
        case 'Agua de Red':
            return '#8dd3c7';
        case 'Camion cisterna':
            return '#8dd3c7';
        case 'Cisterna, tanque':
            return '#ffffb3';
        case 'Escuela':
            return '#bebada';
        case 'Mangueras':
            return '#bebada';
        case 'Pozo de agua':
            return '#fb8072';
        case 'Puesto vacios':
            return '#80b1d3';
        case 'Represa':
            return '#80b1d3';
        case 'Sin agua':
            return '#fdb462';
        case 'Sin dato':
            return '#b3de69';
        case 'Techo cisterna':
            return '#b3de69';
        case 'Techo cisterna, Pozo de agua':
            return '#fccde5';
        default:
            return '#000000'; // Color por defecto si la categoría no coincide con ninguna de las especificadas
    }
}

// Estilo para cada feature del GeoJSON
function stylePuestos(feature) {
    return {
        radius:7,
        fillColor: getColor(feature.properties.TIPO_ABAST),
       color: getColor(feature.properties.TIPO_ABAST),
        weight: 1,
        opacity: 1,
        fillOpacity: 0.6
    };
}
